import React, { useState, useEffect } from "react";
import "./Home.css";
import { useNavigate } from "react-router-dom";

const Home = () => {

    const navigate = useNavigate();
  // Example static data (can replace with MongoDB fetch logic later)
  const fetchEvents = () => {
    return [
      { id: 1, title: "Senior UI Developer", rate: "$120/hr", company: "Nike", logo: "https://logo.clearbit.com/nike.com" },
      { id: 2, title: "Senior Backend Engineer", rate: "$150/hr", company: "Google", logo: "https://logo.clearbit.com/google.com" },
      { id: 3, title: "Azure Data Engineer", rate: "$125-145/hr", company: "Airbnb", logo: "https://logo.clearbit.com/airbnb.com" },
      { id: 4, title: "Azure Data Engineer", rate: "$125-145/hr", company: "Airbnb", logo: "https://logo.clearbit.com/airbnb.com" },
    ];
  };

  const [events, setEvents] = useState([]);

  useEffect(() => {
    setEvents(fetchEvents());
  }, []);

  return (
    <div className="home-container">

      {/* Navbar */}
      <div className="navbar">
        <div className="nav-left">
          <button onClick={() => navigate("/")}>Home</button>
          <button onClick={() => navigate("./Home.js")}>About</button>
          <button onClick={() => navigate("./Home.js")}>Contact</button>
        </div>
        <div className="nav-right">
          <button onClick={() => navigate("../Profile/User/usrProfile.js")}>Profile</button>
        </div>
      </div>

      {/* Main Content */}
      <div className="content">
        <div className="events-container">
          {events.map((event) => (
            <div className="event-card" key={event.id}>
              <div className="event-header">
                <p className="event-rate">{event.rate}</p>
                <button className="bookmark-btn">ðŸ”–</button>
              </div>
              <h3 className="event-title">{event.title}</h3>
              <div className="event-footer">
                <img src={event.logo} alt={`${event.company} logo`} className="event-logo" />
                <p className="event-company">{event.company}</p>
                <button className="view-btn">View</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Home;
